style.css:
@-moz-document domain("web.whatsapp.com") {
body {
    background-color: #FFC7E3;
    background-image: linear-gradient(to bottom, #FFABD8 20%, #FFA3D1
 100%)
}

.app-wrapper::before {
    background-color: #F5B5D0;
}

.pane-intro {
    background-color: #FFA3D1;
}

.intro-image {
    background-image: url(https://https://i.pinimg.com/originals/7c/7c/a6/7c7ca6ea7e8230003481d3f59d3a15c0.jpg);
}

.pane-header {
    background-color: #FFC7E1;
}

.pane-chat-tile-container {
    background: linear-gradient(to bottom, #FFA3D1 0%, #FFC7E1 100%);
}

.butterbar {
    background-image: linear-gradient(to bottom, #FFD6FC, #FFB8E5);
}

.dropdown,
.dropdown-picker {
    background-color: #E189B3;
}

.backdrop {
    background-color: #FCCFFF;
}

.popup {
    background-color: #FCCFFF;
}

.btn-plain {
    color: #FFBFF2;
}

.btn-default {
    color: #FCCFFF;
    background-color: #FFBAF1;
}

.subheader-search {
    background-color: #FFA3EA;
}

.cont-input-search {
    background-color: #F3B9D8;
    border: 1px solid #FFA3EA;
}

input {
    background-color: #F3B9D8;
}

.chat {
    background-color: #FFB5FA;
}

.chatlist .chat:hover,
.chatlist .location:hover,
.chatlist .chat.hover,
.chatlist .hover.location {
    background-color: #FFA6E1;
    border-bottom: 1px solid #FFA6E1
}

*::-webkit-scrollbar-thumb {
    background-color: #FFA6E1;
}

*::-webkit-scrollbar {
    background-color: #FFD6F3;
}

.pane-chat {
    background-image: linear-gradient(to bottom, #FFD6F3, #FFD6F3);
}

.message-in {
    background-color: #FFD6F3;
}

.message-out {
    background-color: #FFBAEF;
}

.message-system-body {
    background-color: #FFBAEF;
}

.btn-more {
    background-color: #FFBAEF;
}

.pane-chat-footer {
    background-color: #FFABE9;
}

.input-container {
    background-color: #F5B5D0;
}

.menu-icons-item {
    background-color: #FFABE9;
}

.block-compose .input-container {
    background-color: #F5B5D0;
}

.message-out:before {
    background-image: none;
}

.message-in:before {
    background-image: none;
}

.chatlist .chat.active,
.chatlist .active.location {
    background-color: #F5B5D0;
    border-bottom: 1px solid #F5B5D0;
}

.drawer-header {
    background-color: #E189B3;
}

.drawer-info {
    background-color: #FFCCFF;
}

.well {
    background-color: #FFD6F3;
}

.drawer-profile .drawer-header {
    background-color: #E189B3;
}

.drawer {
    background-color: #FFD6F3;
}

.avatar-overlay {
    color: #FFD6F3;
}

.toast {
    background-color: #E189B3;
    color: #FFD6F3;
}

.pane-intro:after {
    border-top: 6px solid #DD71AF;
}

.message-out .btn-context:after {
    background: linear-gradient(to bottom left, #DD8BBA 0%, #DD8BBA 35%, rgba(220, 248, 198, 0)65%, rgba(220, 248, 198, 0)100%);
}

.message-in .btn-context:after {
    background: linear-gradient(to bottom left, #DD8DCD 0%, #DD8DCD 35%, rgba(220, 248, 198, 0)65%, rgba(220, 248, 198, 0)100%);
}

.block-compose .input-container {
    border-color: #F5B5D0;
}

.dropdown .menu-item:hover,
.dropdown .menu-item:focus {
    background-color: #FFD6F3;
}

.list-title {
    background-color: #FFBFD9;
}

.drawer-header {
    color: #FFBFD9;
}

.intro-title {
    color: #E189B3;
}

.message-out .btn-context {
    background-color: #E189B3;
}

.message-in .btn-context {
    background-color: #FFD6F3;
}

.context.context-in {
    background: linear-gradient(to right, rgba(255, 255, 255, 0)0%, #E189B3 50%)
}

.context.context-out {
    background: linear-gradient(to right, rgba(255, 255, 255, 0)0%, #F3B9D8 50%)
}

.app {
    background-color: #E189B3;
}

.app-wrapper::after {
    background: linear-gradient(to bottom, #FFD6F3 0%, #FFC9DB 40%)
}
}
